$(document).ready(function(){$(".fDelete").each(function(){$(this).click(function(){var a=$(this).attr("objectID");$.ajax({type:"POST",data:{objectID:a},url:"modul/objects/call/removePreset.php",success:function(b){if(b){$("#errorText").html(b);$("#errorAlert").fadeIn("fast")}else{$("#successText").html("Successfully Removed.");$("#successAlert").fadeIn("fast").delay(2000).fadeOut("fast");$(".singleObjectEntry").each(function(){if($(this).attr("objectID")==a){$(this).slideUp("slow",function(){$(this).remove()})}})}}})})});$("#searchInput").on("keyup",function(){var d,g,f,b,c,e;d=document.getElementById("searchInput");g=d.value.toUpperCase();f=document.getElementById("searchList");b=f.getElementsByClassName("searchRow");for(e=0;e<b.length;e++){c=b[e].getElementsByClassName("searchFor")[0];if(c.innerHTML.toUpperCase().indexOf(g)>-1){b[e].style.display=""}else{b[e].style.display="none"}}});$(".objectHeader").each(function(){$(this).click(function(){var a=$(this).attr("objectID");$(".objectContent").each(function(){if($(this).attr("objectID")==a){$(this).slideToggle("fast")}else{if($(this).attr("objectID")!=a){if($(this).css("display")!="none"){$(this).slideUp("fast")}}}})})})});